import Joi from '@hapi/joi';
import Video from '../models/video.model';
import HttpStatus from 'http-status-codes';

export default {
    findAll (req, res, next ) {
        Video.find()
        .then(videos => res.json(videos))
        .catch(err => res.json(err));
    },

    create (req, res) {
        const schema = Joi.object().keys({
            title: Joi.string().required(),
            url: Joi.string().required(),
            description: Joi.string().required(),
            date: Joi.date().required(),
            author: Joi.string().optional(),

        });
        const {error, value } = Joi.validate(req.body, schema);
        if (error  && error.details) {
            return res.status(HttpStatus.BAD_REQUEST).json(error);
        }

        Video.create(value)
        .then(video => {
            res.json(video);
        })
        .catch(err => res.status(HttpStatus.INTERNAL_SERVER_ERROR).json(err));
    },

    findOne(req, res) {
        let {id} = req.params;
        Video.findById(id)
            .then(video=> {
                if(!video) {
                    return res.status(HttpStatus.NOT_FOUND).json({err: 'Could not find any video'});
                }
                return res.json(video);
         })
         .catch(err => res.status(HttpStatus.INTERNAL_SERVER_ERROR).json(err));

    },
    delete(req, res) {
        let {id} = req.params;
        Video.findByIdAndRemove(id)
            .then(video => {
                if(!video) {
                    return res.status(HttpStatus.NOT_FOUND).json({err: 'Could not delete any video'});
                }
                return res.json(video);
            }).catch(err => res.status(HttpStatus.INTERNAL_SERVER_ERROR).json(err));
    },
    update(req, res) {
        let {id} = req.params;
        const schema = Joi.object().keys({
            title: Joi.string().optional(),
            url: Joi.string().optional(),
            description: Joi.string().optional(),
            date: Joi.date().optional(),
            author: Joi.string().optional(),

        });
        const {error, value } = Joi.validate(req.body, schema);
        if (error  && error.details) {
            return res.status(HttpStatus.BAD_REQUEST).json(error);
        }
        Video.findAndUpdate({_id: id}, value, {new: true})
            .then(video => res.json(video))
            .catch(err => res.status(HttpStatus.INTERNAL_SERVER_ERROR).json(err));        
    }
};

